import React from "react";
import s from './DogCard.css';

export default function DogCard({name, image, temperament, weight_min, weight_max }){
    return (
        <div className="conteinerAll">
            <div >
                <div >
                
                    <div className="cardContImg">
                        
                        <img src={image} alt={`${name}`} className="cardImg" />
                    </div>

                    <div className="cardInfo" >
                       <h1 className="cardTitle">{name}</h1> 
                       <h2 className="cardTemperament">Temperament:</h2>
                        
                        <h4>{function (temperament) {
                            if (typeof (temperament) === 'string') {
                                return temperament
                            }
                            if (Array.isArray(temperament)) {
                                let temps = temperament.map(e => e.name)
                                return temps.join(', ')
                            }
                        }(temperament)}</h4>

                    

                        <h2>Weight:</h2>
                        <h4>De {weight_min} Kg. a {weight_max} Kg.</h4>
                        </div>
                        </div>
                    </div>
                    </div>
                
    )
}
